-- ----------------------------
-- Table structure for areas
-- ----------------------------
DROP TABLE IF EXISTS `areas`;
CREATE TABLE `areas` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '区域主键',
  `area_name` varchar(20) NOT NULL COMMENT '区域名称',
  `summary_name` varchar(20) DEFAULT NULL,
  `area_code` varchar(20) DEFAULT NULL COMMENT '区域码，由影院编码前几位提取的区域编码。',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '父级区域ID',
  `city_level` int(11) DEFAULT '0' COMMENT '城市等级： 1: 一线城市，2：二线城市；3：三线城市；',
  `area_level` smallint(6) DEFAULT NULL COMMENT '0：国家；1：省；2：市；3：地区，4：大区',
  `area_grade` varchar(20) DEFAULT NULL COMMENT '区域等级: firstTier',
  `first_letter` varchar(2) DEFAULT NULL,
  `pinyin` varchar(100) DEFAULT NULL,
  `is_disabled` bit(1) DEFAULT NULL COMMENT '0：不禁用，1：禁用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `crc` int(11) NOT NULL DEFAULT '1' COMMENT '记录完整性校验',
  PRIMARY KEY (`id`),
  KEY `AreaCodeIndex` (`area_code`)
) ENGINE=InnoDB AUTO_INCREMENT=45454546 DEFAULT CHARSET=utf8 COMMENT='行政区域主表';

